-- Method Definition

function coord2px(x,y,t)

 if t == 1 then
  px_x = 14+(x-1)*21.5+1.75
  px_y = 10+(y-1)*21.5+1.75
 elseif t == 0 then
  px_x = 14+(x-1)*21.5+6.5
  px_y = 10+(y-1)*21.5+17.5
 end
 return px_x,px_y

end

function switchTurn()
 turn = 3-turn
 --local direction = 2*turn-3
 --sel = {5,5+2*direction,5,5+2*direction,false}
 sel[1] = sel[3]
 sel[2] = sel[4]
 sel[5] = false
end

function setChess(chs,coord_x,coord_y,gc)

 if chs.belong ~= -1 then
  gc:setFont("sansserif","r",9)
  gc:drawImage(image.new(chessImg[chs.belong]), coord2px(coord_x,coord_y,1))
  if chs.promoted == true then
   gc:setFont("sansserif","r",9)
   gc:setColorRGB(255,69,0)
  end
  gc:drawString(chessType[chs.ctype], coord2px(coord_x,coord_y,0))
  gc:setColorRGB(0,0,0)
 end

end

function resetBoard()

 board[1] = {Chess:new(1,7,false),Chess:new(1,6,false),Chess:new(1,5,false),Chess:new(1,4,false),Chess:new(1,1,false),Chess:new(1,4,false),Chess:new(1,5,false),Chess:new(1,6,false),Chess:new(1,7,false)}
 board[2] = {nulChess,Chess:new(1,2,false),nulChess,nulChess,nulChess,nulChess,nulChess,Chess:new(1,3,false),nulChess}
 board[3] = {Chess:new(1,8,false),Chess:new(1,8,false),Chess:new(1,8,false),Chess:new(1,8,false),Chess:new(1,8,false),Chess:new(1,8,false),Chess:new(1,8,false),Chess:new(1,8,false),Chess:new(1,8,false)}

 board[9] = {Chess:new(2,7,false),Chess:new(2,6,false),Chess:new(2,5,false),Chess:new(2,4,false),Chess:new(2,1,false),Chess:new(2,4,false),Chess:new(2,5,false),Chess:new(2,6,false),Chess:new(2,7,false)}
 board[8] = {nulChess,Chess:new(2,3,false),nulChess,nulChess,nulChess,nulChess,nulChess,Chess:new(2,2,false),nulChess}
 board[7] = {Chess:new(2,8,false),Chess:new(2,8,false),Chess:new(2,8,false),Chess:new(2,8,false),Chess:new(2,8,false),Chess:new(2,8,false),Chess:new(2,8,false),Chess:new(2,8,false),Chess:new(2,8,false)}

 for i=4,6 do
  for j=1,9 do
   board[i][j] = nulChess
  end
 end

end

function setBoard(gc)

 gc:setColorRGB(220,20,60)
 if turn == 2 then
  gc:fillRect(3,198,5,5)
 else
  gc:fillRect(3,10,5,5)
 end

 if sel[5] == true then
  if displayValidMove == true then
   for i=1,9 do
    for j=1,9 do
     if chessCanMove(sel[1],sel[2],i,j,nil) then
      gc:setColorRGB(255,0,0)
      gc:drawRect(14+(i-1)*21.5,14+(j-1)*21.5-4,21,21)
     end
    end
   end
  end
  gc:setColorRGB(255,215,0)
  gc:fillRect(14+(sel[1]-1)*21.5,14+(sel[2]-1)*21.5-4,21.5,21.5)
  gc:setColorRGB(255,69,0)
  gc:fillRect(14+(sel[3]-1)*21.5,14+(sel[4]-1)*21.5-4,21.5,21.5)
 else
  gc:setColorRGB(255,215,0)
  gc:fillRect(14+(sel[1]-1)*21.5,14+(sel[2]-1)*21.5-4,21.5,21.5)
 end
 gc:setColorRGB(0,0,0)

 for i=1,9 do
  for j=1,9 do
   setChess(board[i][j],j,i,gc)
  end
 end

end

function selectMove(x,y)
 if sel[5] == true then
  sel[3],sel[4]=sel[3]+x,sel[4]+y
 else
  sel[1],sel[2]=sel[1]+x,sel[2]+y
 end
end

function chessCanMove(from_x,from_y,to_x,to_y,advance)
 if advance == nil then
  chs = board[from_y][from_x]
 else
  chs = advance
 end
 local direction = 2*turn-3 -- 1 Up,-1 Down 
 --#####print(from_x..from_y..to_x..to_y)
 if (from_y == to_y and from_x == to_x) or (board[to_y][to_x].belong == chs.belong) then
  return false
 else
  if chs.ctype == 8 and chs.promoted == false then -- Fu
   if (to_y ~= from_y-direction or to_x ~= from_x) then
    return false
   end
  elseif chs.ctype == 7 and chs.promoted == false then --Kyou
   if from_x~=to_x or (to_y-from_y)*direction>0 then
    return false
   end
   for i=from_y-direction,to_y+direction,-direction do
    if board[i][from_x].belong ~= -1 then
     return false
    end
   end
  elseif chs.ctype == 6 and chs.promoted == false then -- Kei
   if to_y~=from_y-2*direction then
    return false
   end
   if to_x~=from_x+1 and to_x~=from_x- 1 then
    return false
   end
  elseif chs.ctype == 5 and chs.promoted == false then -- Gin
   if math.abs(to_y-from_y)>1 or math.abs(to_x-from_x)>1 then
    return false
   end
   if (to_x==from_x-1 or to_x==from_x+1) and to_y==from_y then
    return false
   end
   if to_y==from_y+direction and to_x==from_x then
    return false
   end
  elseif chs.ctype == 4 or ((chs.ctype == 5 or chs.ctype == 6 or chs.ctype == 7 or chs.ctype == 8) and chs.promoted == true) then -- Kin and Promoted ones
   if math.abs(to_y-from_y)>1 or math.abs(to_x-from_x)>1 then
    return false
   end
   if to_y==from_y+direction and (to_x==from_x+1 or to_x==from_x-1) then
    return false
   end
  elseif chs.ctype == 3 and chs.promoted == false then -- Kaku
   if math.abs(to_y-from_y)~=math.abs(to_x-from_x) then
    return false
   end
   if to_y-from_y>0 and to_x-from_x>0 then ----Right and Down
    for i=1,math.abs(to_y-from_y)-1 do
     if board[from_y+i][from_x+i].belong ~= -1 then
      return false
     end
    end
   elseif to_y-from_y>0 and to_x-from_x<0 then ----Left and Down
    for i=1,math.abs(to_y-from_y)-1 do
     if board[from_y+i][from_x-i].belong ~= -1 then
      return false
     end
    end
   elseif to_y-from_y<0 and to_x-from_x<0 then ----Left and Up
    for i=1,math.abs(to_y-from_y)-1 do
     if board[from_y-i][from_x-i].belong ~= -1 then
      return false
     end
    end
   elseif to_y-from_y<0 and to_x-from_x>0 then ----Right and Up
    for i=1,math.abs(to_y-from_y)-1 do
     if board[from_y-i][from_x+i].belong ~= -1 then
      return false
     end
    end
   end
  elseif chs.ctype == 3 and chs.promoted == true then -- Uma
   if math.abs(to_y-from_y)~=math.abs(to_x-from_x) then
    if (math.abs(to_y-from_y)>1 or math.abs(to_x-from_x)>1) then
     return false
    else
     return true
    end
   end
   if to_y-from_y>0 and to_x-from_x>0 then ----Right and Down
    for i=1,math.abs(to_y-from_y)-1 do
     if board[from_y+i][from_x+i].belong ~= -1 then
      return false
     end
    end
   elseif to_y-from_y>0 and to_x-from_x<0 then ----Left and Down
    for i=1,math.abs(to_y-from_y)-1 do
     if board[from_y+i][from_x-i].belong ~= -1 then
      return false
     end
    end
   elseif to_y-from_y<0 and to_x-from_x<0 then ----Left and Up
    for i=1,math.abs(to_y-from_y)-1 do
     if board[from_y-i][from_x-i].belong ~= -1 then
      return false
     end
    end
   elseif to_y-from_y<0 and to_x-from_x>0 then ----Right and Up
    for i=1,math.abs(to_y-from_y)-1 do
     if board[from_y-i][from_x+i].belong ~= -1 then
      return false
     end
    end
   end
  elseif chs.ctype == 2 and chs.promoted == false then -- Hi
   if (to_y~=from_y and to_x~=from_x) then
    return false
   end
   if to_y==from_y then
    for i=math.min(to_x,from_x)+1,math.max(to_x,from_x)-1 do
     if board[to_y][i].belong ~= -1 then
      return false
     end
    end
   else
    for i=math.min(to_y,from_y)+1,math.max(to_y,from_y)-1 do
     if board[i][to_x].belong ~= -1 then
      return false
     end
    end
   end
  elseif chs.ctype == 2 and chs.promoted == true then -- Ryu
   if (to_y~=from_y and to_x~=from_x) then
    if (math.abs(to_y-from_y)>1 or math.abs(to_x-from_x)>1) then
     return false
    else
     return true
    end
   end
   if to_y==from_y then
    for i=math.min(to_x,from_x)+1,math.max(to_x,from_x)-1 do
     if board[to_y][i].belong ~= -1 then
      return false
     end
    end
   else
    for i=math.min(to_y,from_y)+1,math.max(to_y,from_y)-1 do
     if board[i][to_x].belong ~= -1 then
      return false
     end
    end
   end
  elseif chs.ctype == 1 then -- Ou
   if math.abs(to_y-from_y)>1 or math.abs(to_x-from_x)>1 then
    return false
   end
  end
  return true
 end
end

function promoteChess()
 validMove = false
 for i=1,9 do
  for j=1,9 do
   if chessCanMove(sel[3],sel[4],i,j,board[sel[2]][sel[1]])==true then
    validMove = true
    break
   end
  end
  if validMove == true then
   break
  end
 end
 
 if validMove == false or promotion[turn] == 1 then
  board[sel[2]][sel[1]].promoted = true
 end
 
end

function moveChess()
 if (board[sel[2]][sel[1]].promoted == false and board[sel[2]][sel[1]].ctype ~= 1 and board[sel[2]][sel[1]].ctype ~= 4) then
  if (turn == 2) then
   if (sel[4] == 1 or sel[4] == 2 or sel[4] == 3) then
    promoteChess()
   end
  else
   if (sel[4] == 7 or sel[4] == 8 or sel[4] == 9) then
    promoteChess()
   end
  end
 end
 board[sel[4]][sel[3]] = board[sel[2]][sel[1]]
 board[sel[2]][sel[1]] = nulChess
end

function dropChess(char)
 if board[sel[2]][sel[1]].belong ~= -1 then
  return false
 end

 char = string.upper(char)
 direction = 2*turn-3
 ctp = 1
 validMove = false
 
 while chessType[ctp] ~= char do
  ctp = ctp + 1
 end
 
 if avaliableChess[turn][ctp-1] <= 0 then
  return false
 end
 
 chs = Chess:new(turn,ctp,false)
 
 if ctp == 8 then -- Fu
  for i=1,9 do
   if board[i][sel[1]].belong == turn and board[i][sel[1]].ctype == 8 then
    return false
   end
  end
 end
 
 for i=1,9 do
  for j=1,9 do
   if chessCanMove(sel[1],sel[2],i,j,chs)==true then
    validMove = true
    break
   end
  end
  if validMove == true then
   break
  end
 end
 
 if validMove == false then
  return false
 end
 
 board[sel[2]][sel[1]] = chs
 avaliableChess[turn][ctp-1] = avaliableChess[turn][ctp-1]-1
 sel[3] = sel[1]
 sel[4] = sel[2]
 switchTurn()
 
end
